script: |
  super -f text -I q1242.spq | sort > q1242.out

inputs:
  - name: q1242.spq
    data: |
      SELECT ALL 29 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - 16 * - col0 + + col1 = + 92 * col0 OR NOT + 91 IS NOT NULL;
  - name: tab1

outputs:
  - name: q1242.out
    data: |
      29
      29
      29
